import React, { Component } from 'react';

import store from '../store.js';

const ToolpathList = (state) => {

  return (
    <Table>
      <Table.Head>
        <Table.SearchHeaderCell />
        <Table.TextHeaderCell></Table.TextHeaderCell>
        <Table.TextHeaderCell></Table.TextHeaderCell>
      </Table.Head>
      <Table.Body height={240}>
        {state.toolpaths.map(path => (
          <Table.Row key={path.name} isSelectable onSelect={() => alert(path.name)}>
            <Table.TextCell>{path.type}</Table.TextCell>
            <Table.TextCell>{path.name}</Table.TextCell>
            <Table.TextCell isNumber> 1 </Table.TextCell>
          </Table.Row>
        ))}
      </Table.Body>
    </Table>
  )
}

export {ToolpathList}
